import React from 'react';
import './App.css';
import { connect } from 'react-redux'

function App(props) {
  return (
    <div className="App">
      sup
      {props.state.a}
      {props.state.b}
    </div>
  );
}

const mapStateToProps = (state) => {
  return {
    a: state.a,
    b: state.b
  }
}

export default connect(mapStateToProps)(App);
